import React from 'react';

const syllabusContext = React.createContext({
  //all dataBases
  dataRequestHandler: () => {},
  dataRequestDetails: '',
  dataReceiverHandler: () => {},
  resetHandlerChoice: () => {},
  storeData: '',

  //calendarData
  everythingCalendar: '',

  //syllabusData
  syllabusData: () => {},
  everythingSyllabus: '',

  //tasksData
  tasksData: '',
  newDataHandler: () => {},
  showLeftOverTasksForWeek: ''

  //UI
});

export default syllabusContext;
